package com.oyetalk.example1.domain.entity;import cn.hutool.json.JSONUtil;import com.cyber.domain.entity.PagingEntity;import com.oyetalk.example1.domain.request.CreateApplicationRequest;import java.util.Date;public class Application extends PagingEntity {    private String tenantCode;	private String applicationCode;	private String applicationName;	private String applicationAk;	private String applicationSk;	public String getTenantCode() {		return tenantCode;	}	public void setTenantCode(String tenantCode) {		this.tenantCode = tenantCode;	}	public String getApplicationCode() {	    return this.applicationCode;	}	public void setApplicationCode(String applicationCode) {	    this.applicationCode=applicationCode;	}	public String getApplicationName() {	    return this.applicationName;	}	public void setApplicationName(String applicationName) {	    this.applicationName=applicationName;	}	public String getApplicationAk() {	    return this.applicationAk;	}	public void setApplicationAk(String applicationAk) {	    this.applicationAk=applicationAk;	}	public String getApplicationSk() {	    return this.applicationSk;	}	public void setApplicationSk(String applicationSk) {	    this.applicationSk=applicationSk;	}	public static void main(String[] args) {		CreateApplicationRequest createApplicationRequest = new CreateApplicationRequest();		createApplicationRequest.setCreateTime(new Date());		createApplicationRequest.setApplicationCode("APPCODE");		createApplicationRequest.setApplicationName("APPNAME");		createApplicationRequest.setCreator("WDY");		createApplicationRequest.setRemark("REMARK");		System.out.println(JSONUtil.toJsonStr(createApplicationRequest));	}}